import React from 'react';
import {Link} from 'react-router-dom';
import {Button, Field, Control} from 'react-bulma-components';


/*<input type="search" className="main-search-bar" placeholder="Search for cards.."></input>
<Link to="/cardDisplay">
    <Button color="primary" outlined rounded size ="small">
        search
    </Button>
</Link>*/

export default function MainSearch() {
    return (
        <div>
                    
        <div class="field">
            <label class="label">Search Bar</label>
            <div class="control">
                <input class="input" type="text" placeholder="Search for cards..."></input>
            </div>

        </div>

        <Link to="/cardDisplay">
            <Button color="primary" outlined rounded size ="small">
                search
            </Button>
        </Link>

        </div> 
    )   
}
